import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = {
    id: 0,
    users: []
  }

  componentDidMount() {
    this.getDataFromDb();
  }

  getDataFromDb = () => {
    fetch("http://localhost:3001/api/getData")
      .then(data => data.json())
      .then(res => this.setState({ data: res.data }));
  };

  render() {
    const { data } = this.state;
    return (
      <div>Users :
        <ul>
          {data.map(dat =>
            (<li>
              <span>dat.id</span>
              <span>dat.username</span>
            </li>))
          }
        </ul>
      </div>
    );
  }
}

export default App;
